package me.melo.cloud.usercenter.entity;import com.baomidou.mybatisplus.annotation.IdType;import com.baomidou.mybatisplus.annotation.TableId;import com.baomidou.mybatisplus.annotation.TableName;import java.io.Serializable;import java.time.LocalDateTime;import io.swagger.annotations.ApiModel;import io.swagger.annotations.ApiModelProperty;/** * <p> * 组织表 * </p> * * @author ljhua * @since 2022-08-08 */@TableName("sys_org")@ApiModel(value = "SysOrg对象", description = "组织表")public class SysOrg implements Serializable {    private static final long serialVersionUID = 1L;    @ApiModelProperty("id")    @TableId(value = "id", type = IdType.AUTO)    private Long id;    @ApiModelProperty("租户id")    private Long tenantId;    @ApiModelProperty("父组织id")    private Long parentId;    @ApiModelProperty("所有上级组织id的集合，便于机构查找")    private String ancestors;    @ApiModelProperty("组织类型：1：事业部  2：机构  3：盐城")    private String orgType;    @ApiModelProperty("组织名称")    private String orgName;    @ApiModelProperty("组织编码")    private String orgKey;    @ApiModelProperty("组织图标")    private String orgIcon;    @ApiModelProperty("组织级别（排序）")    private Integer orgLevel;    @ApiModelProperty("1有效，0禁用")    private Integer orgStatus;    @ApiModelProperty("省")    private String province;    @ApiModelProperty("市")    private String city;    @ApiModelProperty("区")    private String area;    @ApiModelProperty("街道")    private String street;    @ApiModelProperty("描述")    private String comments;    @ApiModelProperty("创建者")    private Long createdBy;    @ApiModelProperty("创建时间")    private LocalDateTime createdTime;    @ApiModelProperty("更新者")    private Long modifiedBy;    @ApiModelProperty("更新时间")    private LocalDateTime modifiedTime;    @ApiModelProperty("1:删除 0:不删除")    private Integer delFlag;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public Long getTenantId() {        return tenantId;    }    public void setTenantId(Long tenantId) {        this.tenantId = tenantId;    }    public Long getParentId() {        return parentId;    }    public void setParentId(Long parentId) {        this.parentId = parentId;    }    public String getAncestors() {        return ancestors;    }    public void setAncestors(String ancestors) {        this.ancestors = ancestors;    }    public String getOrgType() {        return orgType;    }    public void setOrgType(String orgType) {        this.orgType = orgType;    }    public String getOrgName() {        return orgName;    }    public void setOrgName(String orgName) {        this.orgName = orgName;    }    public String getOrgKey() {        return orgKey;    }    public void setOrgKey(String orgKey) {        this.orgKey = orgKey;    }    public String getOrgIcon() {        return orgIcon;    }    public void setOrgIcon(String orgIcon) {        this.orgIcon = orgIcon;    }    public Integer getOrgLevel() {        return orgLevel;    }    public void setOrgLevel(Integer orgLevel) {        this.orgLevel = orgLevel;    }    public Integer getOrgStatus() {        return orgStatus;    }    public void setOrgStatus(Integer orgStatus) {        this.orgStatus = orgStatus;    }    public String getProvince() {        return province;    }    public void setProvince(String province) {        this.province = province;    }    public String getCity() {        return city;    }    public void setCity(String city) {        this.city = city;    }    public String getArea() {        return area;    }    public void setArea(String area) {        this.area = area;    }    public String getStreet() {        return street;    }    public void setStreet(String street) {        this.street = street;    }    public String getComments() {        return comments;    }    public void setComments(String comments) {        this.comments = comments;    }    public Long getCreatedBy() {        return createdBy;    }    public void setCreatedBy(Long createdBy) {        this.createdBy = createdBy;    }    public LocalDateTime getCreatedTime() {        return createdTime;    }    public void setCreatedTime(LocalDateTime createdTime) {        this.createdTime = createdTime;    }    public Long getModifiedBy() {        return modifiedBy;    }    public void setModifiedBy(Long modifiedBy) {        this.modifiedBy = modifiedBy;    }    public LocalDateTime getModifiedTime() {        return modifiedTime;    }    public void setModifiedTime(LocalDateTime modifiedTime) {        this.modifiedTime = modifiedTime;    }    public Integer getDelFlag() {        return delFlag;    }    public void setDelFlag(Integer delFlag) {        this.delFlag = delFlag;    }    @Override    public String toString() {        return "SysOrg{" +            "id=" + id +            ", tenantId=" + tenantId +            ", parentId=" + parentId +            ", ancestors=" + ancestors +            ", orgType=" + orgType +            ", orgName=" + orgName +            ", orgKey=" + orgKey +            ", orgIcon=" + orgIcon +            ", orgLevel=" + orgLevel +            ", orgStatus=" + orgStatus +            ", province=" + province +            ", city=" + city +            ", area=" + area +            ", street=" + street +            ", comments=" + comments +            ", createdBy=" + createdBy +            ", createdTime=" + createdTime +            ", modifiedBy=" + modifiedBy +            ", modifiedTime=" + modifiedTime +            ", delFlag=" + delFlag +        "}";    }}